  false,\n\t\"url\": null,\n\t\"notes\": \"The white tailed deer herd on St. Vincent
  Island represents an important part of the island's biotic community. To maintain
  the integrity of the island's deer population, it is necessary to monitor various
  aspects of animal's biology, its environmental and socio-economic ramifications.
  While much of the information relating to deer is collected for other purposes,
  e.g. census should be part of the refuge wildlife inventory plan and hunting reported
  as part of public use, these procedures and record keeping systems are consolidated
  and incorporated as part of this program. This program has been designed primarily
  as a working tool for the refuge staff. The sections are separated for ease in revision
  when required.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
